import { Fragment } from 'react';
import './App.css';
import Home from './Home';
import { Route, Routes } from 'react-router-dom';
import Form from './Form';

function App() {
  return (
    <Fragment>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        <Route path='/form' element={<Form />}></Route>
      </Routes>
    </Fragment>
  );
}

export default App;
